contracts/Usuario.sol.content:
pragma solidity >=0.7.0 <0.9.0;

/** 
 * @title Usuario
 */
contract Usuario {

    address identificador;
    string apodo;

    constructor(address _identificador, string memory _apodo) {
        identificador = _identificador;
        apodo = _apodo;
    }

}

/** 
 * @title Usuario
 */
contract Grupo {

    address identificador;
    string apodo;
    MatrisUsuario _matrisUsuario;

    constructor(address _identificador, string memory _apodo) {
        identificador = _identificador;
        apodo = _apodo;
        _matrisUsuario = new MatrisUsuario();

    }

    function addUsuario( Usuario _usuario ) public returns(bool) {
        _matrisUsuario.push(_usuario);
        return true;
    }

}

contract MatrisUsuario{

    Usuario[] usuarios;

    constructor() public {}

    function push( Usuario _usuario ) public {
        usuarios.push(_usuario);
    }

    function pop( ) public {
        usuarios.pop();
    }

    function length() public view returns (uint) {
        return usuarios.length;
    }

}

contract myTest{

    Grupo grupo;

    constructor() public {

    }

}

